#include<iostream>
#include<vector>

using namespace std; 

#define  CharToIndex(c) ( (int) c - (int) 'a') 
#define ALPHA_SIZE  26
//#define DEBUG 

typedef struct Mytrie_node{
    int value;
    int pass; // 0 unknown, 1 pass, -1 fail  
    Mytrie_node * children[ALPHA_SIZE];
    Mytrie_node():value(0), pass(0){ } 
} mytrie_node; 

/*
typedef struct Mytrie {
    mytrie_node * root; 
    int count;
} mytrie;
*/

class MyTrie{
    mytrie_node * root; 
    int cnt;

    mytrie_node * getNode(void){
	mytrie_node *pNode = new mytrie_node;
	if(pNode ){
	    pNode->value = 0;
	    pNode->pass = 0 ;
	    for( int i = 0 ; i < ALPHA_SIZE ; i++){
		pNode->children[i] = NULL;
	    }
	}
	return pNode;
    }

    void deleteMyTrie( mytrie_node * rt){
	if(rt){
	    for( int i = 0 ; i < ALPHA_SIZE ; i++){
		deleteMyTrie(rt->children[i]);
	    }
	    delete rt;
	    rt = NULL;
	}

    }
    

public:

    void printTrie(){
	printTrieRec(root, -1);
    };

    void printTrieRec( mytrie_node * rt , int idx ){
	if(rt){
	    if(idx < ALPHA_SIZE && idx >= 0 ){
		char c = (char) ( idx + (int) 'a');
		cout<<c<<" pass "<< rt->pass <<endl;
	    }
	    for( int i = 0 ; i < ALPHA_SIZE ; i++){
		printTrieRec(rt->children[i], i);

	    }

		cout<<endl;
	}
    }

    void insert( string key ){
	int level;
	int length=key.length();
	int index;
	mytrie_node * pCrawl ;

	cnt++;

	pCrawl = root;
//	cout<<"@insert"<<pCrawl<<endl;
	for( level = 0; level < length; level++){
	    index = CharToIndex(key[level]);
//	    cout<<"char "<<key[level]<<endl;
//	    cout<<index<<endl;
	    if(!pCrawl->children[index]){
		pCrawl->children[index] = getNode();
	    }
	    pCrawl = pCrawl->children[index];
	}
	pCrawl->value = cnt;
    }

    bool search( string key ){
	int level ;
	int length = key.length();
	int index;
	mytrie_node * pCrawl;

	pCrawl = root;

	for ( level = 0 ; level < length; level++){
	    index = CharToIndex(key[level]);
	    if( !pCrawl->children[index] ) return false;
	    else{ 
		pCrawl = pCrawl->children[index];
	    }
	}
	return (0!= pCrawl && pCrawl->value);
    }


    MyTrie(){
	cnt = 0;
	root = getNode();
////	cout<<"root@"<<root<<endl;
    }
    ~MyTrie(){
	cnt=0;
	deleteMyTrie(root);
    }

    void checkProcessed(string key){
	int len = key.length();
	mytrie_node * pCrawl = root;
	for(int level = 0 ; level < len ; level++){
	    int index = CharToIndex( key[level]);
	    if ( pCrawl->children[index] ) 
	    {
		pCrawl = pCrawl->children[index];
		if ( pCrawl->pass == 0 ) pCrawl->pass = -1; // set the failure after the key has been processed  
	    }
	}
    }

    bool prefixCheck( string key){

	int len = key.length();
	mytrie_node * pCrawl  = root ; 
	for ( int level = 0 ; level < len; level++){
	    int index = CharToIndex( key[level]);
	    if( pCrawl->children[index] ) {
		pCrawl = pCrawl->children[index];
		if( pCrawl->pass == -1 ) return false;
	//	return true;
	    }
	}
	return true;
    }

//    void  invalidPrefix( string key, int i){
    void validateNode( string key, int i, int pas ){
	int len = key.length();
	if( len <= i ) return ;  
	mytrie_node * pCrawl  = root ; 

	for ( int level = 0 ; level < len ; level++){
	    int index = CharToIndex( key[level]);
	    if( pCrawl->children[index] ) 
	    {
		pCrawl = pCrawl->children[index];
		
		// cout<<"validate "<<i<<endl;
		if( i == level ) {
		    pCrawl->pass = pas ;
		    return ;
		}
	    }
	}
	return;
    }

}; 

class Solution {


    bool searchBoard( 
		     MyTrie & wt, 
		     vector<string> &res,
		     string it , int i,
		     vector< vector<char> > &board, int x, int y 
		    ){

	if( i>= it.length()) {
	    return false;
	}
	if(  x < 0 || y < 0 || x >= board.size() || y >= board[x].size() )  return false;

#ifdef DEBUG
	cout<<board[x][y]<<" it "<<it[i]<< " equal? "<< (board[x][y] == it[i] )<<" i = "<< i << " it length "<<it.length()-1<<endl;
#endif
	if( board[x][y] == it[i] ){ 
	    wt.validateNode( it, i, 1  ) ; 
	    if( i == (it.length() -1)) {
#ifdef DEBUG
		cout<<"hit "<<it<<endl;
#endif
		res.push_back(it); 
		return true;
	    }
	    else{
		char c = board[x][y];
		board[x][y] = '*';

		bool hit = 
		    searchBoard( wt, res, it, i+1, board, x+1, y ) ||
		    searchBoard( wt, res, it, i+1, board, x-1, y ) ||
		    searchBoard( wt, res, it, i+1, board, x, y+1 ) || 
		    searchBoard( wt, res, it, i+1, board, x, y-1 );

		board[x][y] = c;
		// if ( hit == false ) wt.validateNode(it, i+1, -1);
		return hit;
	    }
	}
	return false;
    }

public:
    vector<string> findWords(vector<vector<char>>& board, vector<string>& words) {
	vector<string> res ;

	int sz = 0; 
	int i = 0 ;
	int cnt = 0 ;
	MyTrie wt;

	while( i < words.size() ) {
	    wt.insert(words[i]);
	    i++;
	}
	i = 0 ; 
	while( i < words.size() ) {
	    cnt++;
/*	 
   if( false == wt.prefixCheck( words[i]) ) {
	//	cout<<" pass due to the failure of prefix matching"<<endl;
		goto L1; 
	    }
*/
	    for( int x = 0 ; x < board.size(); x++){
		for( int y = 0 ; y < board[x].size(); y++){
		    if( true == searchBoard( wt, res, words[i] , 0,  board , x, y ) ){ 
			goto L1; 	
		    }
		}
	    }
L1: 
	    wt.checkProcessed( words[i]);
	    // wt.printTrie();
	    i++;
	}
//	cout<<cnt<<endl;
	return res;
    }
};


